PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "pharmaceutics_functionalgroup" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Name" varchar(15) NOT NULL, "ionizable" bool NOT NULL, "polar" bool NOT NULL, "parent_pKa" real NOT NULL, "aromatic" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "pharmaceutics_protein" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Name" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "pharmaceutics_molecule_fg_pka" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "index" integer NOT NULL, "pKa" real NOT NULL, "pKa_type" varchar(7) NOT NULL, "FunctionalGroup_id" bigint NOT NULL REFERENCES "pharmaceutics_functionalgroup" ("id") DEFERRABLE INITIALLY DEFERRED, "Molecule_id" bigint NOT NULL REFERENCES "pharmaceutics_molecule" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "pharmaceutics_aminoacid" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "ionizable" bool NOT NULL, "polar" bool NOT NULL, "aromatic" bool NOT NULL, "full_carbon_count" integer NOT NULL, "branched" bool NOT NULL, "essential" bool NOT NULL, "singlet_code" varchar(1) NOT NULL, "triplet_code" varchar(3) NOT NULL, "charge" varchar(9) NOT NULL, "sulfur" bool NOT NULL, "volume" varchar(11) NOT NULL, "Molecule_id" bigint NOT NULL UNIQUE REFERENCES "pharmaceutics_molecule" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "pharmaceutics_molecule" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Molecule_Name" varchar(50) NOT NULL, "SMILES" varchar(200) NOT NULL, "LiteraturePka" real NULL, "Difficulty" varchar(9) NOT NULL, "Reference" varchar(1000) NOT NULL, "Ion_Type" varchar(9) NOT NULL);
CREATE TABLE IF NOT EXISTS "pharmaceutics_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Key" varchar(40) NOT NULL);
CREATE TABLE IF NOT EXISTS "pharmaceutics_user_FGs_Solved" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "pharmaceutics_user" ("id") DEFERRABLE INITIALLY DEFERRED, "molecule_id" bigint NOT NULL REFERENCES "pharmaceutics_molecule" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "pharmaceutics_user_Maps_Solved" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "pharmaceutics_user" ("id") DEFERRABLE INITIALLY DEFERRED, "molecule_id" bigint NOT NULL REFERENCES "pharmaceutics_molecule" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "pharmaceutics_user_Pkas_Solved" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "pharmaceutics_user" ("id") DEFERRABLE INITIALLY DEFERRED, "molecule_id" bigint NOT NULL REFERENCES "pharmaceutics_molecule" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "pharmaceutics_user_Rotbs_Solved" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "pharmaceutics_user" ("id") DEFERRABLE INITIALLY DEFERRED, "molecule_id" bigint NOT NULL REFERENCES "pharmaceutics_molecule" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "pharmaceutics_solvedquery" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Query_id" bigint NOT NULL REFERENCES "pharmaceutics_query" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "pharmaceutics_quiz2attempt" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Timestamp" varchar(20) NOT NULL, "Secs_Taken" integer NOT NULL, "Answer1" varchar(6) NOT NULL, "Answer2" varchar(6) NOT NULL, "Answer3" varchar(6) NOT NULL, "Answer4" varchar(6) NOT NULL, "Answer5" varchar(6) NOT NULL, "User_id" bigint NOT NULL REFERENCES "pharmaceutics_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "pharmaceutics_quiz1attempt" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Timestamp" varchar(20) NOT NULL, "Secs_Taken" integer NOT NULL, "Answer1" varchar(6) NULL, "Answer2" varchar(6) NULL, "Answer3" varchar(6) NULL, "Answer4" varchar(6) NULL, "Answer5" varchar(6) NULL, "User_id" bigint NOT NULL REFERENCES "pharmaceutics_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "pharmaceutics_query" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "MapMode" bool NOT NULL, "Time" varchar(20) NOT NULL, "Molecules_id" bigint NOT NULL REFERENCES "pharmaceutics_molecule" ("id") DEFERRABLE INITIALLY DEFERRED, "User_id" bigint NOT NULL REFERENCES "pharmaceutics_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "pharmaceutics_subjectivefeedback" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Difficulty" varchar(18) NOT NULL, "Molecule_id" bigint NOT NULL REFERENCES "pharmaceutics_molecule" ("id") DEFERRABLE INITIALLY DEFERRED, "User_id" bigint NOT NULL REFERENCES "pharmaceutics_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "pharmaceutics_user_Qb2s_Solved" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "pharmaceutics_user" ("id") DEFERRABLE INITIALLY DEFERRED, "molecule_id" bigint NOT NULL REFERENCES "pharmaceutics_molecule" ("id") DEFERRABLE INITIALLY DEFERRED);
